import React from "react";
import { useStateValue } from "../StateProvider/StateProvider";

function Checkout() {
  const [{ basket }] = useStateValue();

  return (
    <div className="checkout">
      <img
        className="checkout__ad"
        src="https://previews.123rf.com/images/aleksorel/aleksorel1711/aleksorel171100014/90022671-credit-card-advertising-vector-illustration-contactless-bank-credit-debit-card-promotion-creative-co.jpg"
        alt=""
      />
    </div>
  );
}

export default Checkout;
